import yt_dlp
from tkinter import filedialog
import threading
from PIL import Image, ImageTk
import tkinter as tk
import base64
import io
import os
import platform


root = tk.Tk()
root.config(bg="white")
root.geometry("600x450")
root.title("Landri Downloader")

image_b64 = "data:image/png;base64,"
logo_64 = "data:image/png;base64,"

image_data = base64.b64decode(image_b64.split(',')[1])
logo_data = base64.b64decode(logo_64.split(',')[1])

image = Image.open(io.BytesIO(image_data))
logo = Image.open(io.BytesIO(logo_data))
logo_resized = image.resize((image.width // 3, image.height // 3))
logobello = ImageTk.PhotoImage(logo_resized)
logoicona = ImageTk.PhotoImage(logo)

desktop = os.getcwd()

def choose_path():
    desktop = filedialog.askdirectory()

def download(url: str):
    path = desktop
    ydl_opts = {
        'outtmpl': f'{path}/%(title)s',
        'noplaylist': True,
        'format': 'bestvideo[ext=mp4]+bestaudio[ext=m4a]/best[ext=mp4]/best',
    }

    if url: 
        if path:
            try:
                with yt_dlp.YoutubeDL(ydl_opts) as ydl:
                    ydl.download([url])
                print(f"Download successful! Saved to {path}.")
                DlCompleted.pack()
            except Exception as e:
                print(f"An error occurred while downloading the video: {e}")
            finally:
                DlButton.config(state='normal')
                LinkInput.delete(0, tk.END)
        else:
            print("No path selected.")
            DlButton.config(state='normal')
            LinkInput.delete(0, tk.END)
            LinkInput.config(highlightbackground="red")
            DlCompleted.config(text="No path selected.", fg="red")
            DlCompleted.pack()

    else:
        print("No URL inserted.")
        DlButton.config(state='normal')
        LinkInput.delete(0, tk.END)
        LinkInput.config(highlightbackground="red")
        DlCompleted.config(text="Insert the link first.", fg="red")
        DlCompleted.pack()



def download_thread():
    DlButton.config(state='disabled')
    threading.Thread(target=download, args=(LinkInput.get(),)).start()

def download_audio_thread():
    DlButtonAudio.config(state='disabled')
    threading.Thread(target=download_audio, args=(LinkInput.get(),)).start()


def download_audio(url: str):
    path = desktop
    yt_dl_onlyaudio = {
        'outtmpl': f'{path}/%(title)s.%(ext)s',
        'noplaylist': True,
        'format': 'bestaudio/best',
        'postprocessors': [{
            'key': 'FFmpegExtractAudio',
            'preferredcodec': 'mp3',
            'preferredquality': '192',
        }],
    }

    if url: 
        if path:
            try:
                with yt_dlp.YoutubeDL(yt_dl_onlyaudio) as ydl:
                    ydl.download([url])
                print(f"Download successful! Saved to {path}.")
                DlButtonAudio.config(state='normal')
                DlCompleted.pack()
            except Exception as e:
                print(f"An error occurred while downloading the video: {e}")
            finally:
                DlButton.config(state='normal')
                LinkInput.delete(0, tk.END)
        else:
            print("No path selected.")
            DlButtonAudio.config(state='normal')
            LinkInput.delete(0, tk.END)
            LinkInput.config(highlightbackground="red")
            DlCompleted.config(text="No path selected.", fg="red")
            DlCompleted.pack()

    else:
        print("No URL inserted.")
        DlButtonAudio.config(state='normal')
        LinkInput.delete(0, tk.END)
        LinkInput.config(highlightbackground="red")
        DlCompleted.config(text="Insert the link first.", fg="red")
        DlCompleted.pack()

root.iconphoto(False, logoicona)

frame = tk.Frame(root)
frame.place(relx=0.5, rely=0.5, anchor="center")

titleFrame = tk.Frame(frame)
buttonFrame = tk.Frame(frame)
titleFrame.pack(side="top")
buttonFrame.pack(side="bottom")

label = tk.Label(frame, text="Insert the video link:", font=("Arial", 30), fg="black", width=40, height=2)
ChoosePath = tk.Button(frame, text="Choose Path", command=choose_path, width=8, font=("Arial", 20))
LinkInput = tk.Entry(frame, font=("Arial", 24), width=30, insertbackground='black', bg='white', bd=3, relief="solid", fg="black")
DlButton = tk.Button(buttonFrame, text="Download Video", command=download_thread, width=15, font=("Arial", 25))
DlButtonAudio = tk.Button(buttonFrame, text="Download Audio", command=download_audio_thread, width=15, font=("Arial", 25))
DlCompleted = tk.Label(frame, text="Completed!", font=("Arial", 20), fg="black", width=40, height=2)


labelimg = tk.Label(titleFrame, image=logobello)
labelDl = tk.Label(titleFrame, text="DL", font=("Verdana", 50), fg="black", width=2, height=2)

labelimg.pack(side="left")
labelDl.pack(side="left")

label.pack()
ChoosePath.pack()
DlButton.pack(side="left", pady=15)
DlButtonAudio.pack(side="bottom", pady=15, padx=15)
LinkInput.pack(side="bottom", pady=15)

frame.configure(bg="white")
label.configure(bg="white")
frame.configure(bg="white")
labelimg.configure(bg="white")
buttonFrame.configure(bg="white")
labelDl.configure(bg="white")
titleFrame.configure(bg="white")
DlButton.configure(bg="white")
DlButtonAudio.configure(bg="white")
DlCompleted.configure(bg="white")

root.mainloop()
